import React, { useCallback, useState } from "react";
import Header from './components/Header'
import Form from './components/Form'
import './components/Form.css'


import "./App.css"

type User = {
    id: string;
    name: string;
    email: string;
    whatsapp: number;
}

export const App: React.FC = () => {
    const [user, setUser] = useState<User>({} as User);

    const handleChange = useCallback((e: React.FormEvent<HTMLInputElement>) => {
        setUser({
            ...user,
            [e.currentTarget.name]: e.currentTarget.value,
        });
    }, [user]);

    return (
        <div>
            <Header></Header>
            <Form name="name" mask="nome" onChange={handleChange}>
                <div className="formWrapper">
                    <label className="nome" >Nome</label>
                    <input onKeyUp={handleKeyUp} type="text" />
                    <label className="email">Email</label>
                    <input type="email" />
                    <label className="whats">WhatsApp</label>
                    <input onKeyUp={handleKeyUp} type="text" name="Whats" id="whats_id" />
                </div>
                <div className="aut">
                    <input className="checkbox" type="checkbox" name="Autorizacao" id="autorizacao_id" />
                    <label className="autorizacao" >Eu atorizo um consutor da Smile entrar em contato comigo via WhatsApp.</label>
                </div>
                <button >ENVIAR</button>
            </Form>
        </div>
    )
};
